import city from '../../city.svg'
import catpic from '../../cat.svg'
import catest from '../../catest.svg'
import { useState, useRef } from "react";
import './cat.css';
function Cat(){
    const ref = useRef();

    /*useEffect(() => {
        ref.dispatchEvent(new KeyboardEvent('keypress',{
            key:'Enter'
        }));
    }, [])*/
    const event = new KeyboardEvent('keypress', {
        key: 'enter',
      });

    return (
        <div className='text-white w-full px-8 py-2 h-screen'>
            <div className='bg-gradient-to-b from-amber-900 via-black to-amber-900 w-full h-full relative'>
                <p className='text-center text-amber-600'></p>
                <div className='w-full absolute bottom-[50px] '>
                    <div className='bg-repeat  h-96 mx-12 animate-cityAnimation relative' style = {{ backgroundImage: `url(${city})` }}>
                    <button className='text-4xl animate-titleFade absolute right-[555px] text-amber-700'>Welcome, Click to see more</button>

                    </div>

                </div>

                <div className='w-full overflow-hidden max-h-[110px] max-w-[190px] absolute bottom-[50px] left-[150px]'>
                    <div className='bg-no-repeat h-[3000px] w-[3000px] animate-catAnimation' style = {{ backgroundImage: `url(${catpic})` }}></div>

                </div>



            </div>




        </div>
    )
}
export default Cat;
